                         + 4 * shelter_high_roof;\n\n        for (var i = 0; i &lt; color.length; i++) {\n            fc = \"red\";\n            diff = wind[i] - s + offset + shelter_height_effects;\n\n            if (diff &lt; -20) {\n                fc = \"green\";\n            }\n            else if (diff &lt; 0) {\n                fc = \"yellow\";\n            }\n            else if (diff &lt; 10) {\n                fc = \"salmon\";\n            }\n            else if (diff &lt; 20) {\n                fc = \"indianred\";\n            }\n            color[i] = fc;\n\n        }\n\n        source.change.emit();\n        // console.log(s);\n        "},"id":"98b977ae-704d-49bc-b9e3-63398307a258","type":"CustomJS"},{"attributes":{"dimension":1,"plot":{"id":"f3e581b4-ac9e-48d4-87a6-42c65c505bc1","subtype":"Figure","type":"Plot"},"ticker":{"id":"3d0ad311-023f-4ecf-8402-17b8092fe687","type":"BasicTicker"}},"id":"eceda81c-8ea2-4245-b255-3fa9899743a3","type":"Grid"},{"attributes":{"callback":{"id":"98b977ae-704d-49bc-b9e3-63398307a258","type":"CustomJS"},"options":["Ground level","Roof level","10m"],"title":"Height of measurements","value":"Ground level"},"id":"6568eb27-8c21-43b4-9994-c6727e6fcf88","type":"Select"},{"attributes":{"source":{"id":"851b4aa9-8bf4-44a7-a1cd-e70986cbd656","type":"ColumnDataSource"}},"id":"01e7aef5-f397-4d0b-97dd-9fd1519711e3","type":"CDSView"},{"attributes":{"bottom_units":"screen","fill_alpha":{"value":0.5},"fill_color":{"value":"lightgrey"},"left_units":"screen","level":"overlay","line_alpha":{"value":1.0},"line_color":{"value":"black"},"line_dash":[4,4],"line_width":{"value":2},"plot":null,"render_mode":"css","right_units":"screen","top_units":"screen"},"id":"d171b0c5-577c-4027-a96f-c03bf4b381ce","type":"BoxAnnotation"},{"attributes":{"callback":{"id":"98b977ae-704d-49bc-b9e3-63398307a258","type":"CustomJS"},"end":200,"start":20,"title":"Shelter base withstand (km/h)","value":50},"id":"eefb40db-719a-4ba3-8e51-d9a9dfa3c0d9","type":"Slider"},{"
